import React from 'react';
import { Media } from 'react-bootstrap';

export default function Media1() {
    return (
        <div>




            <ul className="list-unstyled">
                <Media as="li">
                    <img
                        width={64}
                        height={64}
                        className="mr-3"
                        src="holder.js/64x64"
                        alt="Generic placeholder"
                    />
                    <Media.Body>
                        <h5>List-based media object</h5>
                        <p>
                            Cras sit amet nibh libero, in gravida nulla. Nulla vel metus scelerisque
                            ante sollicitudin commodo. Cras purus odio, vestibulum in vulputate at,
                            tempus viverra turpis. Fusce condimentum nunc ac nisi vulputate
                            fringilla. Donec lacinia congue felis in faucibus.
      </p>
                    </Media.Body>
                </Media>



            </ul>
        </div>
    )
}





{
    bivakzones.features
        .map((bivakzone) => {
            if (bivakzone.geometry.type === 'Point') {
                return (bivakzone)

            } else {
                bivakzone.geometry.coordinates =
                    bivakzone.geometry.coordinates[0][0]
                bivakzone.geometry.type = 'Point'
                return (bivakzone)
            }
        })

        .map((bivakzone) => (
            <ul bivakzone={bivakzone} className='figure' key={bivakzone.id}>

                <Card.Img className='photo' bg="info" variant="top" src={`${bivakzone.properties.image}`} />

            </ul>
        ))
}
